INSERT INTO `news` (`id`, `id_user`, `title`, `text`, `rating`, `date`) VALUES
(24, 1, 'Animals and pets', 'There are a lot of animals on our planet. They can be wild and domestic. Wild animals are those animals who live in nature without people. Wolves, foxes, giraffes are wild animals. Domestic animals are animals who live with people, who are not really scary. People always call them âpetsâ. Cats, dogs, sheep are domestic animals.', 1, '2022-10-26 10:09:22'),
(26, 1, 'Can animals predict natural disasters?', 'An interesting article(from buzzle.com) about the link between animal behaviours and natural disasters.Vocabulary test includes synonym,antonym and word definition questions.Reading comprehension test questionsÃÂÃÂ´form is similiar to SAT reading test questions.Have a great weekend!', 3, '2022-10-28 14:07:05'),
(29, 1, 'The Nile crocodile', 'The Nile crocodile, C. Niloticus of Africa is undisputedly one of the fiercest predators ever that roam on our planet. They have been on top of the food chain for more than 3 million years, and their adaptability indicates that they are here to stay.A Nile crocodile is capable of taking down almost any living being that visits the banks of African waters.Even in this modern era of human dominance, the Nile crocodile attacks and kills approximately 150-200 people every year.Its survival techniques are so impeccable and effective that it hardly had to change since the Cretaceous period, where they once hunted the Dinosaurs.', 1, '2022-10-28 13:26:00'),
(30, 1, 'Lion', 'The lion is one of the largest predators in the wild. The perfect blend of strength and agility enables the lion to dominate other predators in its habitat. With a group that contains up to 15 intelligent adults, a pride of lions does not fear any other creature in the wild. As designed over a million years of evolution, this predator has no visible weaknesses. However, its population is in a highly vulnerable state due to human activities like poaching and deforestation.', 1, '2022-10-28 13:26:40'),
(31, 2, 'Red Fox', 'Since the ancient times, the Red Foxes have been hunted by humans, but their adaptability and resourcefulness is such that they still exist in huge numbers today. After conquering the entire northern hemisphere, the species invaded Australia, where it was once introduced by humans. And surprisingly, when modern humans invaded their range, the cunning Red Fox found new ways to survive close to human settlements and farmlands. One way or the other, the Red Fox population is flourishing under human dominance; surviving and proving that they are well-capable of invading their invaders.', 1, '2022-10-28 13:27:50');

